#
# Structure for table "s_app_order"
#

CREATE TABLE `s_app_order` (
  `ID` varchar(32) NOT NULL,
  `USER_ID` varchar(32) DEFAULT NULL COMMENT '用户id',
  `SHOP_ADDRESS` varchar(255) DEFAULT NULL,
  `SHOP_PHONE` varchar(11) DEFAULT NULL,
  `SHOP_USERNAME` varchar(50) DEFAULT NULL,
  `ORDER_NO` varchar(22) DEFAULT NULL COMMENT '订单编号',
  `TYPE` varchar(2) DEFAULT NULL COMMENT '00销售订单、01购买订单',
  `CREATE_DATE` datetime DEFAULT NULL COMMENT '创建订单时间',
  `DELIVER_DATE` datetime DEFAULT NULL COMMENT '订单发货日期',
  `FINISH_DATE` datetime DEFAULT NULL COMMENT '订单完成日期',
  `ORDER_STATU` varchar(32) DEFAULT NULL COMMENT '00代付款,01代发货02,已发货,03已完成,20已取消',
  `EXPRESS_PRICE` decimal(32,2) DEFAULT NULL COMMENT '运费',
  `EXPRESS_NAME` varchar(100) DEFAULT NULL,
  `EXPRESS_NO` varchar(50) DEFAULT NULL,
  `TOTAL_PRICE` decimal(32,2) DEFAULT NULL,
  `SHOP_ID` varchar(32) DEFAULT NULL COMMENT '店铺id',
  `ISSEET` varchar(2) DEFAULT '00' COMMENT '是否结算佣金（00否01是）',
  `OPENID` varchar(50) DEFAULT NULL COMMENT 'openid',
  `comm` int(32) DEFAULT '0' COMMENT '佣金相关值',
  PRIMARY KEY (`ID`),
  KEY `订单状态` (`ORDER_STATU`) USING BTREE,
  KEY `订单编号` (`ORDER_NO`) USING BTREE,
  KEY `用户id` (`USER_ID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单主表';

