#

INSERT INTO `s_app_shop_guide` VALUES ('1','什么是U小店?','<div style=\"margin-top:1.5em;\">\n        <span style=\"padding-left: 0.9em;\"><b>1、什么是U小店？</b></span>\n      </div>\n      <div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\n        <span style=\"color: #666666;\">它是一个可以通过社交网络实现你轻松赚钱想法的微电商。你只需要开设U小店，并通过社交网络分享U小店的商品，促成订单后就能收获佣金，成单越多，佣金越多。在整个交易过程中，你只管做好推广，就慢慢坐等数钱吧。</span>\n</div><div style=\"margin-top:0.8em; margin-left: 1.5em;margin-right: 1.4em; margin-top: 25px;\">\n        <div  style=\"width: 100%;\">\n          <img src=\"http://114.215.46.20:8080/zmdApi/fileDowload/file.do?filepath=img/u2.png\" width=\"100%\"/>\n        </div>\n      </div>\n      <div style=\"margin-top:1.5em;\">\n        <span style=\"padding-left: 0.9em;\"><b>2、一张图带你学会使用U小店</b></span>\n      </div>\n      <div style=\"margin-top:0.8em; margin-left: 2em;margin-right: 1.9em; margin-top: 25px; margin-bottom: 50px;\">\n        <div  style=\"width: 100%;\">\n          <img src=\"http://114.215.46.20:8080/zmdApi/fileDowload/file.do?filepath=img/u1.png\" width=\"100%\"/>\n</div>\n</div>','IE4jNear',NULL),('2','如何推广U店和商品','<div style=\"margin-top:1.5em;\">\r\n\t\t\t\t<span style=\"padding-left: 0.9em;\"><b>1、店铺推广</b></span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\">店铺设置完毕，商品也有了，那么开始推广您的店铺啦~</span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\"><span style=\"color: red;\">Step1. </span>点击首页【在售商品】，进入在售商品列表页面。</span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.7em; margin-top: 25px;\">\r\n\t\t\t\t<div  style=\"width: 100%;\">\r\n\t\t\t\t\t<img src=\"http://114.215.46.20:8080/zmdApi/fileDowload/file.do?filepath=img/dptg.png\" width=\"100%\"/>\r\n\t\t\t\t</div>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\"><span style=\"color: red;\">Step2. </span> 在U小店商品列表页面，点击右上角的 <span style=\"color: red;\">【推广】</span>即可推广自己的店铺给好友。</span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.7em; margin-top: 25px;\">\r\n\t\t\t\t<div  style=\"width: 100%;\">\r\n\t\t\t\t\t<img src=\"http://114.215.46.20:8080/zmdApi/fileDowload/file.do?filepath=img/fengxiang.png\" width=\"100%\"/>\r\n\t\t\t\t</div>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\"><span style=\"color: red;\">Step3. </span>可以选择多种渠道进行推广哦~</span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.7em; margin-top: 25px;\">\r\n\t\t\t\t<div  style=\"width: 100%;\">\r\n\t\t\t\t\t<img src=\"http://114.215.46.20:8080/zmdApi/fileDowload/file.do?filepath=img/fengxiang3.png\" width=\"100%\"/>\r\n\t\t\t\t</div>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:1.5em;\">\r\n\t\t\t\t<span style=\"padding-left: 0.9em;\"><b>2、商品推广</b></span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\">店铺中有优质商品发布了，快快推广给您的好友吧~</span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\"><span style=\"color: red;\">Step1. </span>进入商品详情页面，点击右上角<span style=\"color: red;\">【分享】</span>即可推广优质商品给好友了 。</span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.7em; margin-top: 25px;\">\r\n\t\t\t\t<div  style=\"width: 100%;\">\r\n\t\t\t\t\t<img src=\"http://114.215.46.20:8080/zmdApi/fileDowload/file.do?filepath=img/shangping.png\" width=\"100%\"/>\r\n\t\t\t\t</div>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\"><span style=\"color: red;\">Step2. </span>可以选择多种渠道进行推广哦~</span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.7em; margin-top: 25px; margin-bottom: 50px;\">\r\n\t\t\t\t<div  style=\"width: 100%;\">\r\n\t\t\t\t\t<img src=\"http://114.215.46.20:8080/zmdApi/fileDowload/file.do?filepath=img/fengxiang3.png\" width=\"100%\"/>\r\n\t\t\t\t</div>\r\n\t\t\t</div>','2vVT62Dj',NULL),('3','怎么设置U小店','\t\t\t<div style=\"margin-top:1.5em;\">\r\n\t\t\t\t<span style=\"padding-left: 0.9em;\"><b>1、如何设置U小店？</b></span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\">拥有U小店就够了吗？先跟随小编，好好装扮一下你的U小店吧！</span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\"><span style=\"color: red;\">Step1. </span>点击首页<span style=\"color:red;\">【店铺管理】</span>，进入店铺设置页面。</span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.7em; margin-top: 25px;\">\r\n\t\t\t\t<div  style=\"width: 100%;\">\r\n\t\t\t\t\t<img src=\"http://114.215.46.20:8080/zmdApi/fileDowload/file.do?filepath=img/shop1.png\" width=\"100%\"/>\r\n\t\t\t\t</div>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\"><span style=\"color: red;\">Step2. </span> 依次编辑<span style=\\\"color: red;\\\">店铺名称、简介、头像、主题图片</span>，完善店铺基本信息。 </span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.7em; margin-top: 25px;\">\r\n\t\t\t\t<div  style=\"width: 100%;\">\r\n\t\t\t\t\t<img src=\"http://114.215.46.20:8080/zmdApi/fileDowload/file.do?filepath=img/shop2.png\" width=\"100%\"/>\r\n\t\t\t','W4oiCZCN',NULL),('4','如何提高推广效果','\t\t\t<div style=\"margin-top:1.5em;\">\r\n\t\t\t\t<span style=\"padding-left: 0.9em;\"><b>1、多渠道分享</b></span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\">可通过微信、QQ、手机联系人等社交途径分享你的U小店，也可通过朋友圈、QQ空间发布店铺或者商品推荐软文，让更多人关注到你的U小店。</span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:1.5em;\">\r\n\t\t\t\t<span style=\"padding-left: 0.9em;\"><b>2、与自己的好友互相推荐</b></span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\">可以通过自己的亲朋好友、社交群等途径，发送自己的店铺，与对方互相收藏推荐分享。</span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:1.5em;\">\r\n\t\t\t\t<span style=\"padding-left: 0.9em;\"><b>3、线下活动</b></span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\">多去参加各类线下社交活动，主动结交各种各样的朋友。线下结交的朋友信任度要比网上认识的高，后期更加容易成为潜在客户。</span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:1.5em;\">\r\n\t\t\t\t<span style=\"padding-left: 0.9em;\"><b>4、整合已有资源</b></span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\">(1)微信可以加QQ好友里通微信的朋友为好友。如果小店店主QQ中有很多你的潜在客户，那么你就可以加他们为好友，同时也可以在自己的qq群中推广自己的二维码，增加粉丝。</span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\">(2)其他社交平台好友导入，比如微博、陌陌、脉脉、豆瓣……将这些平台的好友加到自己微信中。其中必须强调下陌陌，里面可快速加很多好友，且好友消费能力都很强。</span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\">(3)把自己产品的潜在客户聚集的社区和贴吧整理出来，分别注册，把社区账号头像或签名设置成自己的微信二维码，不允许传二维码的可以加上微信个人号等，再发送一些与产品相关的干货或技巧的文章，最后附上你的二维码或者微信号。这样一些对你产品感兴趣的人会主动的添加，获得的是精准粉丝。如果有博客或是微博，可以在博客首页或文章最后加上二维码，引导用户进行扫描。</span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:1.5em;\">\r\n\t\t\t\t<span style=\"padding-left: 0.9em;\"><b>5、拓展附近的人</b></span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\">微信里定位出自己的位置，批量和附近的人打招呼，可能你和100个人打招呼有20个人回应你，这20个人就是你的好友了，首先把量积累上来，增加你的潜在客户，这样以后你在朋友圈里发消息他们就会收到，如果他们需要可能会直接联系你购买。。</span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:1.5em;\">\r\n\t\t\t\t<span style=\"padding-left: 0.9em;\"><b>6、优秀的分享文案</b></span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n\t\t\t\t<span style=\"color: #666666;\">分享到朋友圈、QQ空间分享商品时，要编辑优秀的软文，抓住买家的痛点，产生对产品的共鸣，才能吸引买家提高订单转化率。例如以下文案，优秀的文案配上真实的图片，是不是很有诱惑力呢？</span>\r\n\t\t\t</div>\r\n\t\t\t<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.7em; margin-top: 25px;\">\r\n\t\t\t\t<div  style=\"width: 100%;\">\r\n\t\t\t\t\t<img src=\"http://114.215.46.20:8080/zmdApi/fileDowload/file.do?filepath=img/pengyouquan.png\" width=\"100%\"/>\r\n\t\t\t\t</div>\r\n\t\t\t</div>','Py6r7fk5',NULL),('5','佣金计算与提现','<div style=\"margin-top:1.5em;\">\r\n<span style=\"padding-left: 0.9em;\"><b>1、什么是销售佣金？</b></span>\r\n</div>\r\n<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n<span style=\"color: #666666;\">销售佣金是订单的提成金额。当某笔商品订单完结，即订单状态变成“已完成”时，系统会自动对该笔订单进行佣金计算，佣金比例和计算规则最终解释权归爱上岗所有。</span>\r\n</div>\r\n<div style=\"margin-top:1.5em;\">\r\n<span style=\"padding-left: 0.9em;\"><b>2、销售佣金在哪里可以看到？</b></span>\r\n</div>\r\n<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n<span style=\"color: #666666;\">每个人的佣金会按订单自动累加到爱上岗钱包中，在爱上岗钱包中，不仅可以查看佣金总额，还可以查看具体订单的佣金明细，方便随时查询自己的收益情况。</span>\r\n</div>\r\n<div style=\"margin-top:1.5em;\">\r\n<span style=\"padding-left: 0.9em;\"><b>3、销售佣金如何提现？</b></span>\r\n</div>\r\n<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n<span style=\"color: #666666;\">在爱上岗的APP中，点击“我的”，然后在“我的钱包”里可以进行提现，并可以查看提现明细，提现的金额会进入您绑定的银行卡里，要记得及时提现哦。</span>\r\n</div>','CqvIkki8',NULL),('6','售后服务与维权','<div style=\"margin-top:1.5em;\">\r\n<span style=\"padding-left: 0.9em;\"><b>1、售后与维权</b></span>\r\n</div>\r\n<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n<span style=\"color: #666666;\">亲，如果您在店铺管理、分享、购买及售后过程中，遇到任何问题，请直接拨打客服电话<span style=\"color:red;\">400-659-9988</span>进行处理。</span>\r\n</div>','WqIgwO12',NULL),('7','常见问题回答','<div style=\"margin-top:1.5em;\">\r\n<span style=\"padding-left: 0.9em;\"><b>1、如何查询订单物流信息？</b></span>\r\n</div>\r\n<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n<span style=\"color: #666666;\">请先查看订单详情的物流公司及运单号，然后拨打电话给相关物流公司，或者登录物流公司网站，通过运单号码查询该订单当前物流状态。</span>\r\n</div>\r\n<div style=\"margin-top:1.5em;\">\r\n<span style=\"padding-left: 0.9em;\"><b>2、有在线客服提供咨询解答吗？</b></span>\r\n</div>\r\n<div style=\"margin-top:0.6em; margin-left: 0.9em;margin-right: 0.5em;\">\r\n<span style=\"color: #666666;\">现在我们为您提供人工客服电话服务，在线客服功能稍后上线，届时会为您提供更便捷的服务，请耐心等待。</span>\r\n</div>','JbHBDoRt',NULL);

#
# Structure for table "s_app_user"
#

CREATE TABLE `s_app_user` (
  `ID` varchar(32) NOT NULL,
  `USERNAME` varchar(200) DEFAULT NULL COMMENT 'account_code  工号',
  `NICKNAME` varchar(200) DEFAULT NULL COMMENT 'account_name  姓名',
  `PROVINCENAME` varchar(200) DEFAULT NULL COMMENT '省份',
  `CITYNAME` varchar(200) DEFAULT NULL COMMENT '城市',
  `DUTYNAME` varchar(200) DEFAULT NULL,
  `POSITIONNAME` varchar(200) DEFAULT NULL COMMENT '小职位  staff_position_name',
  `EMPLOYEECODE` varchar(200) DEFAULT NULL,
  `SEX` varchar(10) DEFAULT NULL,
  `LEVEL` varchar(2) DEFAULT NULL COMMENT '级别  1菜鸟 2新手 3达人',
  `TOTAL_SCORE` int(11) DEFAULT '0' COMMENT '总积分',
  `MON_SCORE` int(11) DEFAULT '0' COMMENT '本月积分',
  `IMG_PATH` varchar(100) DEFAULT NULL COMMENT '头像路径',
  `PHONE` varchar(30) DEFAULT NULL COMMENT '电话',
  `REGION` varchar(50) DEFAULT NULL COMMENT '大区',
  `SUB_REGION` varchar(50) DEFAULT NULL COMMENT '小区',
  `EMPLOYEE_POSITION_NAME` varchar(100) DEFAULT NULL COMMENT '大职位',
  `JOB_STATUS` varchar(50) DEFAULT NULL COMMENT '员工状态',
  `NEED_PASS` varchar(10) DEFAULT '1' COMMENT '月度通关是否需要通过 是1 否0',
  `ENROLL_TIME` varchar(50) DEFAULT NULL COMMENT '入职时间',
  `OFFBOARD_TIME` varchar(50) DEFAULT NULL COMMENT '离职时间',
  `COMPANY` varchar(150) DEFAULT NULL COMMENT 'Always/Cosine',
  `CITY_LEVEL` varchar(50) DEFAULT NULL COMMENT '城市级别',
  `STORE_CODE` varchar(30) DEFAULT NULL COMMENT '门店编码STORE_CODE',
  `STORE_NAME` varchar(100) DEFAULT NULL COMMENT '门店名称',
  `CLIENT_TYPE` varchar(150) DEFAULT NULL COMMENT '客户类型CLIENT_TYPE',
  `ASCODE` varchar(30) DEFAULT NULL COMMENT '上级AS',
  `AECODE` varchar(30) DEFAULT NULL COMMENT '上级AE',
  `THREEP_CITY` varchar(100) DEFAULT NULL COMMENT '3P城市',
  `PAY_PASSWPRD` varchar(100) DEFAULT NULL COMMENT '支付密码',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
