#
# Procedure "comm_sett"
#

CREATE PROCEDURE `comm_sett`()
BEGIN
	#查询相关数据结算佣金
	#insert into s_app_user_comm (ID,ORDER_NO,PROD_NO,PROD_TOTALPRICE,JS_COMM,PROD_SKUINFO,USER_ID,YJPRO,CREATE_DATE)
		#select ID,ORDER_NO,PROD_NO,PROD_TOTALPRICE,JS_COMM,PROD_SKUINFO,USER_ID,YJPRO,DATE from (
		#	select REPLACE(UUID(),'-','') AS ID,a.ORDER_NO,b.PROD_NO,b.PROD_NUM*b.PROD_PRICE AS PROD_TOTALPRICE,
		#	b.PROD_NUM*b.PROD_PRICE*c.COMMISSION_RATE  as JS_COMM,
		#	b.PROD_SKUINFO,(select USER_ID from s_app_shop where ID=a.SHOP_ID) USER_ID,c.COMMISSION_RATE as YJPRO,date_format(now(),'%Y-%m-%d') as DATE
			#from s_app_order a inner JOIN 
		#	s_app_order_detail b on a.ORDER_NO=b.ORDER_NO
			#INNER JOIN s_app_product_sku c on b.PROD_SKUINFO=c.SKU_INFO
		#	WHERE a.order_statu='03' and a.ISSEET='00' and a.type='00'
	#) a ;
  #改变相关订单为已结算
	#update s_app_order SET ISSEET='01' WHERE 
	#ORDER_NO in (SELECT ORDER_NO FROM s_app_user_comm WHERE CREATE_DATE=date_format(now(),'%Y-%m-%d') GROUP BY ORDER_NO);

		#查询相关数据结算佣金
	insert into s_app_user_comm (ID,ORDER_NO,PROD_TOTALPRICE,USER_ID,CREATE_DATE,YJPRO,JS_COMM)
		select ID,ORDER_NO,PROD_TOTALPRICE,USER_ID,CREATE_DATE,YJPRO,JS_COMM from (
	SELECT ID,ORDER_NO,TOTAL_PRICE as PROD_TOTALPRICE,USER_ID,DATE as CREATE_DATE,COMM/100 as YJPRO,TOTAL_PRICE*COMM/100 as JS_COMM FROM (
	select REPLACE(UUID(),'-','') AS ID,
		a.ORDER_NO,
		a.TOTAL_PRICE,
		(select USER_ID from s_app_shop where ID=a.SHOP_ID) USER_ID,date_format(now(),'%Y-%m-%d') as DATE,
		case when b.ENDPRICE > 0 then
					case when a.TOTAL_PRICE >= b.STARTPRICE and a.TOTAL_PRICE < b.ENDPRICE then b.comm
					else 0 end
		else 
				case when a.TOTAL_PRICE >= b.STARTPRICE then b.comm
				else 0 end
		end COMM
	from s_app_order a INNER JOIN s_app_comm b on b.c_omm=a.comm
	WHERE a.order_statu='03' and a.ISSEET='00' and a.type='00'
	ORDER BY a.ORDER_NO,b.COMM
	 ) a ORDER BY a.COMM DESC 
	) a GROUP BY ORDER_NO ;
  #改变相关订单为已结算
	update s_app_order SET ISSEET='01' WHERE 
	ORDER_NO in (SELECT ORDER_NO FROM s_app_user_comm WHERE CREATE_DATE=date_format(now(),'%Y-%m-%d') GROUP BY ORDER_NO);

END;

#
# Procedure "insert_share_tj"
#

CREATE PROCEDURE `insert_share_tj`()
BEGIN
	#新增用户分享统计
	insert into s_app_share (USER_ID,TIMES,DATE,TYPE)
  select USER_ID,TIMES,DATE,TYPE from (
		select COUNT(ID) TIMES,TYPE,USER_ID,date_format(now(),'%Y-%m-%d') as DATE from  s_app_share_journal where DATE=date_format(now(),'%Y-%m-%d')
		GROUP BY USER_ID,TYPE
) a;
END;

#
# Procedure "update_order_statu"
#

CREATE PROCEDURE `update_order_statu`()
BEGIN
	#超过24小时未付款的订单删除
	-- UPDATE s_app_order a SET a.ORDER_STATU='20' WHERE a.ID IN (SELECT c.ID FROM (select b.ID FROM s_app_order b WHERE (DATE_SUB(NOW(),INTERVAL 1 DAY)>b.CREATE_DATE) AND b.ORDER_STATU='00') c);
	-- 获取超过24小时未付款的订单信息 添加到订单取消表
 insert into s_app_order_cannel (ORDER_ID,ORDER_NO)
  select b.ID,b.ORDER_NO FROM s_app_order b WHERE (DATE_SUB(NOW(),INTERVAL 1 DAY)>b.CREATE_DATE) AND b.ORDER_STATU='00';

insert into s_app_order_suk_cannel (ORDER_NO,PROD_NUM,PROD_NO,PROD_SKUINFO)
  select a.ORDER_NO,a.PROD_NUM,a.PROD_NO,a.PROD_SKUINFO FROM 
(SELECT a.* FROM s_app_order_detail a INNER JOIN s_app_order_cannel b on a.ORDER_NO=b.ORDER_NO) a

;
-- 修改订单状态为已取消

UPDATE s_app_order a SET a.ORDER_STATU='20' WHERE a.ID IN 
(SELECT ORDER_ID FROM s_app_order_cannel)
;
-- 更新产品已售数量
UPDATE s_app_product a INNER JOIN 
s_app_order_suk_cannel b
 ON a.PROD_NO=b.PROD_NO
SET a.SALE_N=a.SALE_N-b.PROD_NUM
;

-- 更新产品sku表已售数量
UPDATE s_app_product_sku a INNER JOIN 
s_app_order_suk_cannel b
 ON a.SKU_INFO=b.PROD_SKUINFO
SET a.SALE_N=a.SALE_N-b.PROD_NUM
;
-- 删除订单取消表信息
delete from s_app_order_cannel
;
delete from s_app_order_suk_cannel
;
	
END;

#
# Procedure "update_ostatu_wancheng"
#

CREATE PROCEDURE `update_ostatu_wancheng`()
BEGIN
	#Routine body goes here...
  -- 已发货超过七天后订单状态自动变为以完成
	UPDATE s_app_order a SET a.ORDER_STATU='03' 
	WHERE a.ID IN (SELECT c.ID FROM 
	(select b.ID FROM s_app_order b WHERE (DATE_SUB(NOW(),INTERVAL 7 DAY)>b.DELIVER_DATE) AND b.ORDER_STATU='02') c);
END;

#
# Procedure "view_tj"
#

CREATE PROCEDURE `view_tj`()
BEGIN
	#浏览次数统计
	insert into s_app_view_tj (TIMES,USER_ID,QUANBU_TJ,THIRTY_TJ,SEVEN_TJ,NINTY_TJ,DATE)
	select SUM(TIMES) TIMES,USER_ID,SUM(QUANBU_TJ)QUANBU_TJ,SUM(THIRTY_TJ)THIRTY_TJ,SUM(SEVEN_TJ)SEVEN_TJ,SUM(NINTY_TJ)NINTY_TJ,date_format(now(),'%Y-%m-%d') as DATE from (
		select COUNT(ID) TIMES,USER_ID,0 as QUANBU_TJ, 0 as THIRTY_TJ,0 as SEVEN_TJ, 0 as NINTY_TJ
		from s_app_view_journal WHERE DATE=date_format(now(),'%Y-%m-%d') GROUP BY USER_ID
		union ALL
		select 0 as TIMES,USER_ID, COUNT(ID) QUANBU_TJ,0 as THIRTY_TJ,0 as SEVEN_TJ, 0 as NINTY_TJ 
		from s_app_view_journal GROUP BY USER_ID
		union ALL
		select 0 as TIMES,USER_ID, 0 as QUANBU_TJ,COUNT(ID) THIRTY_TJ,0 as SEVEN_TJ, 0 as NINTY_TJ 
		from s_app_view_journal WHERE 
		TO_DAYS(NOW()) - TO_DAYS(DATE)<= 30
		GROUP BY USER_ID
		union ALL
		select 0 as TIMES, USER_ID,0 as QUANBU_TJ,0 as THIRTY_TJ, COUNT(ID) SEVEN_TJ,0 as NINTY_TJ  
		from s_app_view_journal WHERE 
		TO_DAYS(NOW()) - TO_DAYS(DATE)<= 7
		GROUP BY USER_ID
		union ALL
		select 0 as TIMES,USER_ID,0 as QUANBU_TJ,0 as THIRTY_TJ ,0 as SEVEN_TJ, COUNT(ID) NINTY_TJ
		from s_app_view_journal WHERE 
		TO_DAYS(NOW()) - TO_DAYS(DATE)<= 90
		GROUP BY USER_ID
	) a GROUP BY USER_ID;
END;

